      <div style={{backgroundColor:'#ffE138'}}>
          <div className='d-flex justify-content-center pb-3 pt-3'>
              &copy; {year.getFullYear()} Aleksandr Shchilkin
          </div>
      </div>

  );
};

export default Footer;
